package num340_LongestSubstringWithAtMostKDistinctCharacters;

import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int lengthOfLongestSubstringKDistinct(String s, int k) {
    	
        int maxlen = 0;
        char[] cs = s.toCharArray();
        Map<Character, Integer> map = new HashMap<Character, Integer>();
        
        int i = 0;
        while (i < cs.length) {
	        	int j = i;
	        	while (j < cs.length && map.size() <= k) {
	        		System.out.println("line 16: j: " + j);
	        	    if (map.containsKey(cs[j])) map.put(cs[j], map.get(cs[j]) + 1);
	        	    else map.put(cs[j], 1);
	        	    j++;
	        	}
	        	System.out.println("line 21");
	        	int len = j - i;
	        	if (map.size() == k + 1) len--;
	        	if (maxlen < len) maxlen = len;
	        	
	        	// next i position
	        	i++;
	        	while (map.size() > k) {
	        		System.out.println("line 27: i: " + i);
	        		while (i < cs.length - 1 && map.containsKey(cs[i]) && map.get(cs[i]) >= 1) {
	        			System.out.println("line 30: i: " + i);
	        			if (map.get(cs[i]) == 1) map.remove(cs[i]);
	        			else map.put(cs[i], map.get(cs[i]) - 1);
	        			i++;
	        		}
	        	}
	        
        }
        return maxlen;
    }
}
